const float bpm = 120.;
const float beat_sec = 60. / bpm;

void mainImage(out vec4 frag_col, in vec2 frag_coord)
{
    vec2 uv = frag_coord / iResolution.xy;
    uv = uv * 2. - 1.;
    uv *= iResolution.xy / min(iResolution.x, iResolution.y);

    // quantize and scale
    uv = round(uv * 40.) / 40.;
    uv /= 1.2;

    vec3 col = mix(
        vec3(.09, .02, 0),
        vec3(.1, .05, 0),
        smoothstep(-.9, 1., uv.x)
    );

    float pulse_fac = pow(1. - fract(iTime / beat_sec), 1.5);

    const vec2 center = vec2(.271, 0);
    float r = length(uv - center);
    float grad = remap01(length(uv - vec2(-.33, -.6)), 0., 1.7);
    if (r < .02)
    {
        col = vec3(.6);
    }
    else if (r < .04)
    {
        col = vec3(.6, .05, .05);
    }
    else if (r < .05)
    {
        col = mix(vec3(.65, .05, .05), vec3(.8, .1, .1), remap01(grad, .473, .54));
    }
    else if (r < .127)
    {
        col = mix(vec3(.65, .03, .01), vec3(.8, .05, .02), remap01(grad, .5, .6));
    }
    else if (r < .15)
    {
        col = mix(vec3(.6, .25, .05), vec3(.7, .4, .05), sqrt(remap01(grad, .4, .55)));
    }
    else if (r < .18)
    {
        col = mix(vec3(.65, .02, .01), vec3(.75, .05, .02), remap01(grad, .5, .6));
    }
    else if (r < .25)
    {
        col = vec3(.003, .002, .0005);
    }
    else if (r < .6)
    {
        col = mix(vec3(.003, .002, .0005), vec3(.008, .006, .004), sqrt(remap01(grad, .14, .9)));

        float angle = degrees(get_angle(uv - center));
        vec3 highlight = vec3(0);

        vec3 prev = highlight;
        highlight = mix(highlight, vec3(1., .8, .6) * (1. + .1 * pulse_fac), remap_clamp(angle, 0., 100., 0., .015));
        highlight = mix(highlight, prev, remap01(angle, 100., 200.));

        prev = highlight;
        highlight = mix(highlight, 1.1 * vec3(.2, .3, 1.) * (1. - .25 * pulse_fac), remap_clamp(angle, 210., 280., 0., .01));
        highlight = mix(highlight, prev, remap01(angle, 280., 350.));

        float moving_angle = angle + .5 * cos(TAU * 2. * iTime);

        prev = highlight;
        highlight = mix(highlight, sqrt(remap_clamp(r, .25, .6, .2, .9)) * vec3(.13, .15, .2), remap_clamp(moving_angle, 35., 50., 0., .8));
        highlight = mix(highlight, prev, remap01(moving_angle, 55., 70.));

        prev = highlight;
        highlight = mix(highlight, sqrt(remap_clamp(r, .25, .6, .2, .75)) * vec3(.13, .15, .2), remap_clamp(moving_angle, 218., 232.5, 0., .65));
        highlight = mix(highlight, prev, remap01(moving_angle, 232.5, 247.));

        col += highlight;

        if (abs(r - .5) < .01 || abs(r - .4) < .01 || abs(r - .3) < .01)
        {
           col *= remap_clamp(abs(moving_angle - 240.), 0., 10., 1., 1.12);
        }

        if (r > .58)
        {
            col *= 2.;
        }
    }

    {
        const vec2 bar_a = center + vec2(.363, -.27);
        const vec2 bar_b = bar_a + .38;
        const vec2 bar_dir = normalize(bar_b - bar_a);
        const vec2 bar_dir_perp = bar_dir.yx * vec2(-1, 1);
        const float bar_thick = .06;

        float bar_d = sd_oriented_box(uv, bar_a, bar_b, bar_thick);
        if (bar_d < 0.)
        {
            col = mix(
                vec3(.03, .03, .05),
                vec3(.09),
                remap_clamp(
                    dot(uv - (bar_a - .5 * bar_thick * bar_dir_perp), bar_dir_perp),
                    -.01, bar_thick,
                    0., 1.
                )
            );
        }

        const vec2 head_a = bar_a - .102 * bar_dir;
        const vec2 head_b = head_a + .185 * bar_dir;
        const vec2 head_dir = normalize(head_b - head_a);
        const vec2 head_dir_perp = head_dir.yx * vec2(-1, 1);
        const float head_thick = .1;

        float head_d = sd_oriented_box(uv, head_a, head_b, head_thick);
        if (head_d < 0.)
        {
            col = mix(
                vec3(.25, .25, .23),
                vec3(.08, .08, .11),
                remap_clamp(
                    dot(uv - (head_a - .5 * head_thick * head_dir_perp), head_dir_perp),
                    0., head_thick,
                    0., 1.
                )
            );
        }
    }

    col *= 1.4;

    col = mix(
        col,
        pow(col, vec3(1. - .1 * pulse_fac)),
        smoothstep(.4, 1.2, r)
    );

    // dither
    float bn = texelFetch(
        iChannel0,
        ivec2(uv * 40. + 500.) % textureSize(iChannel0, 0),
        0
    ).x;
    col += .2 * (bn - .5) / 255.;

    col = pow(col, vec3(1. / 2.2));
    frag_col = vec4(col, 1);
}

