float chebyshev_dist(vec2 a, vec2 b)
{
    return max(abs(a.x - b.x), abs(a.y - b.y));
}

float chebyshev_dist(vec3 a, vec3 b)
{
    return max(
        max(abs(a.x - b.x), abs(a.y - b.y)),
        abs(a.z - b.z)
    );
}

float chebyshev_dist(vec4 a, vec4 b)
{
    return max(
        max(
            max(abs(a.x - b.x), abs(a.y - b.y)),
            abs(a.z - b.z)
        ),
        abs(a.w - b.w)
    );
}

