float bicubic(float a, float b, float c, float d, float t)
{
    float one = t - 1.;
    float two = t - 2.;
    float three = t - 3.;
    return (
        (-one * two * three * a)
        + (t * one * two * d)
        + (3. * t * two * three * b)
        - (3. * t * one * three * c)
    ) / 6.;
}

// |a| * |b| * sin(theta)
float cross2d(vec2 a, vec2 b)
{
    return a.x * b.y - a.y * b.x;
}

// references for barycentric coordinates
